Doha

Travel Documentary hosted by Heidi Hollinger, published by Discovery Channel broadcasted as part of DC Waterfront Cities of the World series in 2013 - English narration


Information
------------------------------

Doha is the richest city in the world with humble beginnings as a small pearl fishing village.

